// TotalValuesContext.js
import React, { createContext, useState, useContext } from "react";

const TotalValuesContext = createContext();

export const TotalValuesProvider = ({ children }) => {
  const [totalValues, setTotalValues] = useState({
    stockLevel: 0,
    outOfStockCount: 0,
    categoryCount: 0,
    stockValue: 0,
  });

  return (
    <TotalValuesContext.Provider value={{ totalValues, setTotalValues }}>
      {children}
    </TotalValuesContext.Provider>
  );
};

export const useTotalValues = () => useContext(TotalValuesContext);
